  false,\n\t\"url\": null,\n\t\"notes\": \"This part of DS 781 presents data for the
  habitat map of the seafloor of the Offshore of Monterey map area, California. The
  vector data file is included in \"Habitat_OffshoreMonterey.zip,\" which is accessible
  from http://dx.doi.org/10.5066/F7F47M6T. This map shows physical marine benthic
  habitats in the Offshore of Monterey map area. Marine benthic habitats represent
  a particular type of water quality, substrate, geomorphology, seafloor process,
  or any other attribute that may provide a habitat for a specific species or an assemblage
  of organisms. Marine benthic habitats are classified using the Coastal and Marine
  Ecological Classification Standard (CMECS), developed by representatives from a
  consortium of federal agencies. CMECS is the U.S. government standard for marine
  habitat characterization. The standard provides an ecologically-relevant structure
  for biologic, geologic, chemical, and physical habitat attributes. This map illustrates
  the geoform and substrate components of the standard. This map was derived from
  seafloor geology map (sheet 10) units by translation of the unit description into
  the best-fit values of CMECS classes. The CMECS classes are documented at https://www.fgdc.gov/standards/projects/FGDC-standards-projects/cmecs-folder/CMECS_Version_06-2012_FINAL.pdf.
  Please refer to Greene and others (2007) for more information regarding the Benthic
  Marine Potential Habitat Classification Scheme and the codes used to represent various
  seafloor features. Reference Cited: Greene, H.G., Bizzarro, J.J., O'Connell, V.M.,
  and Brylinsky, C.K., 2007, Construction of digital potential marine benthic habitat
  maps using a coded classification scheme and its application, in Todd, B.J., and
  Greene, H.G., eds., Mapping the seafloor for habitat characterization: Geological
  Association of Canada Special Paper 47, p. 141-155.\",\n\t\"license_title\": null,\n\t\"extras\":
